            "title": "完美霸王餐",
            "content": "<p><br\/><\/p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">我一直比较喜欢日本的美食电影，《深夜食堂》以及《孤独的美食家》曾一度让我沉沦，我总觉得，人生在世，对于美食的热爱，就应该跟两个故事里的主人公一样。美食，是属于自己才能独享的存在，那种独享美食的幸福，别人无法体会。<span class=\"bjh-br\"><\/span><\/span><\/p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">无意之中，发现了一部新的美食片，叫做《野武士的美食》，在仔细一看，发现这部剧在2017年就上映了，我怎么现在才发现咧？带着对《野武士的美食》的好奇心，我心里思索的更多的是，这里面会展现什么样的美食给我呢？<\/span><\/p><p><img class=\"normal\" width=\"360px\" src=\"https:\/\/pics1.baidu.com\/feed\/71cf3bc79f3df8dc3b1d934bc4f4d48c46102830.jpeg?token=1d6bc5918200b44293c07f8bde1bb62e\"\/><\/p><p style=\"margin-top: 26px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">剧照：吃着美食的退休老人以及吃着美食的野武士。<\/span><\/p><p><img class=\"large\" src=\"https:\/\/pics6.baidu.com\/feed\/e850352ac65c1038433c5b61b9f43514b17e893b.jpeg?token=d8b542ff1cc4aa1f3adef77a03602bd0\"\/><\/p><p style=\"margin-top: 26px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在日本的武士，十有八九都有固定的侍奉主君，有固定的职位，拿着固定的俸禄，还有固定的住处。简单来说，有点像现在的打工人。而野武士，则没有这些固定的产物，属于浪人。所以在我看来，野武士代表着自由，那么野武士的美食，一定也是属于自由的美食吧。<\/span><\/p><p><img class=\"large\" src=\"https:\/\/pics7.baidu.com\/feed\/b8014a90f603738d43235325bffe1656f919ecbd.jpeg?token=c5a921f94fa02cf2511a1a55c8c430b1\"\/><\/p><p style=\"margin-top: 26px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">故事的开场，就是催人清醒的铃声，外加着一边抱怨老婆没叫自己起床一边穿衣服准备上班的香住武。他的老婆笑着说，你不是等待着这一天很久了吗，终于不用闹钟催着起床上班了！香住武这才想起来，自己刚刚退休，已经再也不用在忙碌的为工作而奔波了。<span class=\"bjh-br\"><\/span><\/span><\/p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">说到退休，最近和朋友们聊天，朋友们都感慨着什么时候能够退休啊。我冷笑，一群二三十岁的小女人们，居然想着退休，等着吧。其实退休不退休给我的感觉，好像差不多，最重要的是，自己是否有为自己想要做的事情而努力。<\/span><\/p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">有的人活着，可他已经死了；有的人死了，可他还活着。<\/span><\/p><p><br\/><\/p>",
